import { Route, Routes, NavLink } from 'react-router-dom';
import {receive_product} from './Redux/action'



function App() {


  return (
    <div>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/DisplayItem' element={<DisplayItems/>}/>
        <Route path='/ShoppingCart' element={<ShoppingCart/>}/>
      </Routes>      
    </div>
  );
}

function Home(){
  return(
    <div>
      Welcome to Penny Candy Store!
    </div>
  )

}

function Menu(){
  return(
    <div>
      <DisplayItems/>
      <ShoppingCart/>
    </div>
  );

}

function DisplayItems(){
  const DisplayItem = useProducts();
  receive_product(DisplayItem);

  return(
    <div>
      <h2>{DisplayItem.name}</h2>
    </div>
  )
}

function ShoppingCart(){
